import './css/Section7.css';
import 'swiper/css/effect-coverflow'
import buttonNext from './media/Button-Next.png';
import buttonPrev from './media/Button-Prev.png';
import triangle_play from './media/Polygon.svg';
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Pagination, EffectCoverflow } from "swiper/modules";
import SwiperCore from 'swiper'

// Import Swiper styles
import "swiper/m";
import "swiper/components/navigation/navigation.css";
import "swiper/";
import "swiper/modules/effect-coverflow.scss";

SwiperCore.use([Navigation, Pagination, EffectCoverflow]);
function Section7() {
    return (
        <section className="slider-section">
            <div className="header-strings">
                <div className="slider-header-section">
                    <h1 className="slider-header">РАСШИРЬ ВОЗМОЖНОСТИ</h1>
                </div>
                <div className="under-slider-header-section">
                    <p className="under-slider-header">тарифные планы в <span className='ou-loomin'>ou loomin</span></p>
                </div>
            </div>
            {/* где слайдер должен находиться? Это coverflow слайдер, но мы можем убрать налоны */}
            <Swiper
        navigation
        pagination={{ clickable: true }}
        effect="coverflow"
        coverflowEffect={{
          rotate: 0,
          stretch: 0,
          depth: 0,
          modifier: 1,
          slideShadows: false
        }}
        slidesPerView={2}
        centeredSlides
        style={{ height: "500px" }}
      >
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-1.jpg)"
          }}
        >
          Slide 1
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-2.jpg)"
          }}
        >
          Slide 2
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-3.jpg)"
          }}
        >
          Slide 3
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-4.jpg)"
          }}
        >
          Slide 4
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-5.jpg)"
          }}
        >
          Slide 5
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-6.jpg)"
          }}
        >
          Slide 6
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-7.jpg)"
          }}
        >
          Slide 7
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-8.jpg)"
          }}
        >
          Slide 8
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-9.jpg)"
          }}
        >
          Slide 9
        </SwiperSlide>
        <SwiperSlide
          style={{
            backgroundImage:
              "url(https://swiperjs.com/demos/images/nature-10.jpg)"
          }}
        >
          Slide 10
        </SwiperSlide>
      </Swiper>
            <div className='under-slider-btn-section'>
                <div className="under-slider-btn">
                    <button className="try-btn">Попробовать бесплатно</button>
                    <button className="watch-video"><img src={triangle_play} alt="triangle" className="polygon" /><span>Смотреть видео</span></button>
                </div>
            </div>
        </section>
    );
}

export default Section7;
